import React from 'react'
import { Card } from "./Card";
import RouteCreate from '../images/RouteCreate.png'
import Routeimg from '../images/Routeimg.png'
import RouteMap from '../images/RouteMap.png'
import { useNavigate } from 'react-router-dom';

export  function Cards() {
    const navigate = useNavigate();

    const cards = [
        {
            id: 1,
            title: "My Routes",
            Image: Routeimg,
            button: "/MyRoutes"
        },
        {
            id: 2,
            title: "Create Route",
            Image: RouteCreate,
            button: "/CreateRoute"
        },
        {
            id: 3,
            title: "Map",
            Image: RouteMap,
            button: "/Map"
        }
    ]

  return (
    <div>
        <div className='row' >
            {cards.map(card => (
                <div className='col-sm-4' key={card.id}>
                    <Card title={card.title} Image={card.Image} button={card.button} />
                    </div>
                    ))
            }       
    </div>
    </div>
    )
}
